import styled from 'styled-components'

export const ProfileLink = styled.li`
  margin-right: 0.5rem;
  margin-bottom: 0.5rem;
  display: inline-block;
  font-size: 18px;
  color: black


a {
    color: black

}

`

export const HeadLine = styled.p`
  margin-top: 1.5rem;
  font-family: 'Merriweather', serif;
  font-style: italic;

  font-size: x-large;
`;
